import React from 'react';
import prof from '../image/profile-2.png';
import './SectionF.css';

export default class SectionF extends React.Component {
  render() {
    return (
      <div className='sectionf'>
        <div className='sectionf2'>
          <h2 className='fh2'>What Buyers Says About Us</h2>
          <p className='fp'>
            Lorem Ipsum is simply dummy text of the printing and typesetting
            <br />
            industry. Lorem Ipsum has been the industry’s standard
          </p>
          <div className='sectionf3'>
            <div className='sectionf33'>
              <span className=''>
                <img src={prog} />
              </span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
